    render(){
        return <div className="directory-menu">
            {
                this.state.sections.map(

                 ({id, ...othersSectionProps}) => (
                    <MenuItem key={id} {...othersSectionProps} / >                    
                 )   


                )
            }
        </div>
    }
}

